import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { f4fe, faThumbsUp, faCoffee,fasitting } from '@fortawesome/fontawesome-free-solid'
import "./sidebar.css" 
const Sidebar = () => {
    return (
        <div>
           
        <FontAwesomeIcon icon={f4fe} /> <button >Coffee</button> <br/> <br/>
        <FontAwesomeIcon icon={faThumbsUp} /> <button>Coffee</button> <br/> <br/>
         <button>Coffee</button> <br/> <br/>
        </div>
    );
};

export default Sidebar;
